script: |
  super -f text -I q9806.spq | sort > q9806.out

inputs:
  - name: q9806.spq
    data: |
      SELECT 95 AS col0 FROM tab2 (FORMAT parquet) WHERE + 53 <> + - col1 * col0 + - 90 * + 33 + col1 + + col1 / - col0;
  - name: tab2

outputs:
  - name: q9806.out
    data: |
      95
      95
      95
